    false,nt"url": null,nt"notes": "This narrative report for Erie National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1963. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, and
    raptors- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, vegetation control, and wildfires. Resource management
    is outlined; topics include grazing and haying. The public relations section of
    the report describes recreational uses, Refuge visitors, Refuge participation, hunting,
    violations, and safety. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
